import React from 'react';
import "./Table.css";
import ListView from "./ListView.jsx";

export default class Table extends React.Component {
  render(){
    const { columns, players, game, me } = this.props;

    return(
      <div className='TableWrapper'>
        <table className='Wrapper'>
          <tbody>
            <tr className='Tr'>
                <th className='Th'>Player</th>
                <th className='Th'>Gained</th>
                <th className='Th'>Endowment</th>
                <th className='Th'>Contribution</th>
                <th className='Th'>Penalties</th>
                <th className='Th'>You punished</th>
                <th className='Th'>Punished you</th>
            </tr>
            {players.map((player, i) => {
              console.log(player)
              const punished = player.round.get("punished");
              const punishedBy = player.round.get("punishedBy");
              const penalties = player.round.get("penalties");
              const contribution = player.round.get("contribution");
              const payoff = player.round.get("payoff");
              const costs = player.round.get("costs");
              const remainingEndowment = player.round.get("remainingEndowment");
              const roundPayoff = player.round.get("roundPayoff");
              return(
                <tr className='Tr' key={i}>
                  <td className='Td' >Player</td>
                  <td className='Td' >{roundPayoff}</td>
                  <td className='Td' >{remainingEndowment}</td>
                  <td className='Td' >{contribution}</td>
                  <td className='Td' >{penalties}</td>
                  <td className='Td'>
                  <ListView
                      punishments={punished}
                      game={game}
                      className="punishment-social-view"
                      me={me}
                    />
                  </td>
                  <td className='Td' >
                  <ListView
                    punishments={punishedBy}
                    game={game}
                    className="punishment-social-view"
                    me={me}
                  />
                  </td>
                </tr>
              )
            })}
          </tbody>
        </table>
      </div>
    )
  }
}
